function getix(_Itex,_apik)
{
	if(!query_apik(_apik))
    {
        return "API Error";
    }
    return Base64.encode(Reverse(Base64.encodeURI(_Itex+Reverse(_Itex))));
}

function getDix(_a,_b,_apik)
{
	if(!query_apik(_apik))
    {
        return "API Error";
    }
    return getix(BaseII(Reverse(_a))+Reverse(BaseII(_b)),_apik);
}

function iBasec(_r,_g,_c,_id,_apik)
{
	if(!query_apik(_apik))
    {
        return "API Error";
    }
    return getDix("<isys><a>"+getDix(_r,_g,_apik)+"</a>","<b>"+getDix(_c,_id,_apik)+"</b></isys>",_apik);
}

