function StartTrial()
{
	var Dater=new Date();
	if(window.localStorage["Trial"])
	{
		mdui.alert("/!");
		return false;
	}
	window.localStorage["Trial"]=Base64.encode(Dater.getFullYear())+"/"+Base64.encode(Dater.getMonth());
	window.localStorage["_active_type"]="4";
	mdui.alert(",!");
	return true;
}

function CheckTrial()
{
	var spl=window.localStorage["Trial"].split("/");
	var Dater=new Date();
	spl[0]=Base64.decode(spl[0]);
	spl[1]=Base64.decode(spl[1]);
	if(Dater.getFullYear()>Number(spl[0])||Dater.getMonth()-Number(spl[1])>1)
	{
		return false;
	}
	return true;
}

function CheckExtra()
{
	if(window.localStorage["_extra_id"]=="0")
	{
		return true;
	}
	return false;
}

var Plist=new Array(),PCount,DoBreak="non";

function getParam(paramName)
{ 
	paramValue="",isFound=!1; 
	if(this.location.search.indexOf("?")==0&&this.location.search.indexOf("=")>1)
	{ 
		arrSource=unescape(this.location.search).substring(1,this.location.search.length).split("&");
		i=0; 
		while(i<arrSource.length&&!isFound)
		{
			if(arrSource[i].indexOf("=")>0)
			{
				if(arrSource[i].split("=")[0].toLowerCase()==paramName.toLowerCase())
				{
					paramValue=arrSource[i].split("=")[1];
					isFound=!0;
				}
			}
			i++;
		}
	} 
	return paramValue==""&&(paramValue=undefined),paramValue;
}

