function GetActive()
{
    if(checkLS())
    {
        if(!window.localStorage["_active_type"])
        {
            return false;
        }
        Actype=window.localStorage["_active_type"];
        if(Actype=="1")
        {
            return CheckUserCode();
        }
        if(Actype=="2")
        {
            return CheckDRCode();
        }
        if(Actype=="3")
        {
            return CheckDevA();
        }
	if(Actype=="4")
	{
		return CheckTrial();
	}
	if(Actype=="5")
	{
		return CheckExtra();
	}
        return false;
    }
    return true;
}

